import React, {Component} from 'react'


class Inscri extends Component {
    constructor(){
        super()
        this.state = { message : 'Welcome Visitor',
                        btn : 'Login'}
                    }
                    inscrire(){
                     this.setstate = { message : 'Welcome Visitor2',
                     btn : 'Login2'}
                    }
    
    
    render() {
        return (
      <div>
        <h2>{this.state.message}</h2>
        <br/>
        <button onClick={(message,btn)=>this.inscrire()}>{this.state.btn}</button>
        
      </div>
    )
  }

}
export default Inscri
